import * as actionTypes from '../actions/actionTypes';
import axios from '../../axios-order';


export const formSubmitHandler = () => {
	return dispatch => {
		dispatch(trySubmit())
	}
} 

const authStart = () => {
	return {
		type: actionTypes.TRY_SUBMIT
	}
}

const trySubmit = () => {
	return {
		type: actionTypes.TRY_SUBMIT
	}
}


const endSubmit = () => {
	return {
		type: actionTypes.TRY_SUBMIT
	}
}
